import React from 'react';
import { FaChartLine, FaUsers, FaGlobe } from 'react-icons/fa';

const Hero = () => {
  return (
    <section className="section academic-paper" style={{
      textAlign: 'center',
      position: 'relative',
      overflow: 'hidden',
      minHeight: '100vh',
      display: 'flex',
      alignItems: 'center'
    }}>
      <div className="vietnam-map-bg"></div>
      <div className="lotus-pattern" style={{ top: '10%', left: '10%' }}></div>
      <div className="dong-son-pattern" style={{ top: '20%', right: '15%' }}></div>
      <div className="lotus-pattern" style={{ bottom: '15%', right: '10%' }}></div>

      <div className="container" style={{ position: 'relative', zIndex: 2 }}>
        <h1 className="animate-fadeInUp" style={{
          fontFamily: 'Merriweather, serif',
          fontSize: '4rem',
          fontWeight: '700',
          marginBottom: '2rem',
          lineHeight: '1.2',
          color: '#3e2723',
          textShadow: '2px 2px 4px rgba(139, 69, 19, 0.1)'
        }}>
          Cơ Sở Lý Luận<br />
          <span className="golden-accent" style={{
            fontSize: '3.5rem',
            fontWeight: '400'
          }}>Kinh Tế Thị Trường</span><br />
          <span style={{ 
            color: '#b71c1c',
            fontSize: '3rem'
          }}>Định Hướng Xã Hội Chủ Nghĩa</span><br />
          <span style={{ 
            color: '#5d4037',
            fontSize: '2.5rem',
            fontStyle: 'italic'
          }}>Ở Việt Nam</span>
        </h1>

        <div className="animate-fadeInUp" style={{
          maxWidth: '900px',
          margin: '0 auto 4rem',
          animationDelay: '0.2s'
        }}>
          <p style={{
            fontSize: '1.4rem',
            lineHeight: '1.8',
            color: '#5d4037',
            fontStyle: 'italic',
            marginBottom: '1.5rem',
            fontFamily: 'Lora, serif'
          }}>
            "Mô hình kinh tế độc đáo của Việt Nam: Sự kết hợp biện chứng giữa hiệu quả thị trường và công bằng xã hội"
          </p>
          <div style={{
            width: '100px',
            height: '2px',
            background: 'linear-gradient(90deg, #ffd700, #b71c1c)',
            margin: '0 auto'
          }}></div>
        </div>

        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))',
          gap: '3rem',
          marginTop: '4rem'
        }}>
          <div className="academic-paper animate-fadeInUp" style={{
            padding: '2.5rem',
            borderRadius: '15px',
            textAlign: 'center',
            animationDelay: '0.4s',
            border: '2px solid rgba(255, 215, 0, 0.2)'
          }}>
            <FaChartLine size={56} style={{ color: '#b71c1c', marginBottom: '1.5rem' }} />
            <h3 style={{ 
              fontSize: '1.4rem', 
              fontWeight: '600', 
              marginBottom: '1rem',
              fontFamily: 'Merriweather, serif',
              color: '#3e2723'
            }}>Hiệu Quả Kinh Tế</h3>
            <p style={{ 
              color: '#5d4037',
              lineHeight: '1.7',
              fontFamily: 'Lora, serif'
            }}>Phát triển lực lượng sản xuất và tăng trưởng bền vững</p>
          </div>

          <div className="academic-paper animate-fadeInUp" style={{
            padding: '2.5rem',
            borderRadius: '15px',
            textAlign: 'center',
            animationDelay: '0.6s',
            border: '2px solid rgba(255, 215, 0, 0.2)'
          }}>
            <FaUsers size={56} style={{ color: '#ffd700', marginBottom: '1.5rem' }} />
            <h3 style={{ 
              fontSize: '1.4rem', 
              fontWeight: '600', 
              marginBottom: '1rem',
              fontFamily: 'Merriweather, serif',
              color: '#3e2723'
            }}>Công Bằng Xã Hội</h3>
            <p style={{ 
              color: '#5d4037',
              lineHeight: '1.7',
              fontFamily: 'Lora, serif'
            }}>Đảm bảo phúc lợi và an sinh cho mọi người dân</p>
          </div>

          <div className="academic-paper animate-fadeInUp" style={{
            padding: '2.5rem',
            borderRadius: '15px',
            textAlign: 'center',
            animationDelay: '0.8s',
            border: '2px solid rgba(255, 215, 0, 0.2)'
          }}>
            <FaGlobe size={56} style={{ color: '#8d6e63', marginBottom: '1.5rem' }} />
            <h3 style={{ 
              fontSize: '1.4rem', 
              fontWeight: '600', 
              marginBottom: '1rem',
              fontFamily: 'Merriweather, serif',
              color: '#3e2723'
            }}>Hội Nhập Quốc Tế</h3>
            <p style={{ 
              color: '#5d4037',
              lineHeight: '1.7',
              fontFamily: 'Lora, serif'
            }}>Mở cửa và tham gia chuỗi giá trị toàn cầu</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Hero;
